import {createRouter, createWebHistory} from 'vue-router'
import Home from './views/Home'
import Login from './views/Login'
import Logout from './views/Logout'
import Register from './views/Register'
import VariantList from './views/VariantList'
import addVariant from './views/addVariant'
import Variant from './views/Variant'
import Task1 from './views/Task1'

const routes = [
    {
        path: '/',
        name: 'home',
        component: Home
    },
    {
        path: '/login',
        name: 'login',
        component: Login
    },
    {
        path: '/logout',
        name: 'logout',
        component: Logout
    },
    {
        path: '/register',
        name: 'register',
        component: Register
    },
    // _________ EGE _________
    {
        path: '/ege',
        name: 'ege',
        component: VariantList,
    },
    {
        path: '/ege/add_variant',
        name: 'add-ege-variant',
        component: addEGEVariant,
    },
    // {
    //     path: `/ege/:id/tasks`,
    //     name: 'variant',
    //     component: Variant,
    // },
    {
        path: `/ege/:id/1`,
        name: 'ege-task1',
        component: EGETask1,
    },
    {
        path: `/ege/:id/2`,
        name: 'ege-task2',
        component: EGETask2,
    },
    {
        path: `/ege/:id/3`,
        name: 'ege-task3',
        component: EGETask3,
    },
    {
        path: `/ege/:id/4`,
        name: 'ege-task4',
        component: EGETask4,
    },
    // _________ OGE _________
    {
        path: '/oge',
        name: 'oge',
        component: VariantList,
    },
    {
        path: '/oge/add_variant',
        name: 'add-oge-variant',
        component: addOGEVariant,
    },
    {
        path: `/oge/:id/1`,
        name: 'oge-task1',
        component: OGETask1,
    },
    {
        path: `/oge/:id/2`,
        name: 'oge-task2',
        component: OGETask2,
    },
    {
        path: `/oge/:id/3`,
        name: 'oge-task3',
        component: OGETask3,
    },
    // _________ VPR _________
    {
        path: '/vpr',
        name: 'vpr',
        component: VariantList,
    },
    {
        path: '/vpr/add_variant',
        name: 'add-vpr-variant',
        component: addVPRVariant,
    },
    {
        path: `/vpr/:id/1`,
        name: 'vpr-task1',
        component: VPRTask1,
    },
    {
        path: `/vpr/:id/2`,
        name: 'vpr-task2',
        component: VPRTask2,
    },

]

const router = createRouter({
    history: createWebHistory(process.env.BASE_URL),
    routes
})

export default router
